// import PropTypes from 'prop-types'
import Header from './Header'
import './style.css';

const Details = props => {
    let st = {
        margin: '1%'
    };

  return (
    <div style={st}>
      <Header/>
      
      <div className='detailsContent'>

      </div>

    </div>
  )
}

Details.propTypes = {

}

export default Details
